class Solution:
    def isSubsequence(self, s: str, t: str) -> bool:
        if len(s) >= len(t):
            return s == t
        else:
            res = True
            index = 0 # chç
            indices = []
            n = len(t)
            for ch in s:
                if index < n:
                    tmp = t[index:].find(ch)
                    #print("ch = ", ch, "tmp = ", tmp)
                    if tmp == -1: # no found
                        res = False
                        break
                    else:
                        index += tmp + 1
                        indices.append(index)
                else:
                    res = False
                    break
            #if res:
            #   print("s' = ", "".join(t[i] for i in indices))
            #   print("s  = ", s)

            return res

